아부 잘하고 돈 좀 있는 엘리트 집단에 소속된 판사면 형사 민사 대법 고법등에 근무 할거고 그렇게 하다가 로펌들어가고 
소년부,가정법원,단순민사,행정소송,지방근무 같은 승진 힘든 코스는 간간히 뉴스에 훈훈한 판결 나오고

@riankal 편하게 검사ㅋㅋㅋㅋㅋ 검사는 뭐 집에서 손가락빨고 있으면 시켜줌? 그리고 수배당한건 검사사칭한거 걸려서 도망간거지 그게 변호사일 하다가 수배당한거냐? 
성남시에서부터 현지랑 같이 공무원 폭행했던 영상 이미 전국민이 다 봤는데 혼자만 못봤나? 지 가족한테도 막말하는 인간이 대통령은 무슨 공직자의 기본 자격이 없는 인간이지.
이재명 올려치기한다고 하는 말이 무슨 털보유튜브에서나 할만한 증거없는 찌라시밖에 없냐ㅋㅋㅋㅋ

@free4684ㅋㅋㅋㅋ 그래서 너희들때문에 저런 국회의원들이 떵떵거리며 사는거야. 저들 사탕 발림에 중국 욕 하면서. 20년 전에는 북한 빨갱이다!! 지금은 중국 공산주의자다!! 항상 변함없이 지들이 제일 썩었으면서 ㅎㅎ
난 아직도 기억 난다. 김대중이 북한 지령받아서 대통령되면 나라 북한에 다 넘어간다고 외치던 그 할아버지 를. 
김대중 되고 나서 imf극복하고 북한에 안넘거 갔도니 할아버지가 이제 다음에 넘길거라고. 도대체 언제 넘어가냐
